import Table from "components/Table/Table";
import "./style.css";

export default function RegimenDetails() {
  const data = [
    { id: 1, name: "Alice", age: 30 },
    { id: 2, name: "Bob", age: 35 },
    { id: 3, name: "Charlie", age: 40 },
    { id: 3, name: "Charlie", age: 40 },

    // Add more data as needed
  ];

  return (
    <>
      <div className="cycles">
        <h4>Cycles</h4>
        <div className="row">
          <input type="radio" />
          <span>Every</span>
        </div>
        <div className="row">
          <input type="radio" />
          <span>Day</span>
        </div>
        <button>Check</button>
      </div>
      <div className="medications">
        <h4>Mediactions</h4>
        <div className="premediaction">
          <h3>PreMediactions</h3>
          <Table data={data} />
        </div>
        <div className="chemotherapy">
          <h3>ChemoTherapy</h3>
        </div>
      </div>
      <div className="notes">
        <h4>Physician Notes</h4>
        <input type="text" placeholder="Add your notes here..." />
      </div>
    </>
  );
}
